import React from 'react';

const Title = styled.h1`
  font-size: 1.5em;
  text-align: center;
  color: palevioetred;
`;

const Wrapper = styled.section`
  padding: 4em;
  background: papayawhip;
`;

const Home = () => {
  return (
    <div>Hello, Next!</div>
  )
};

export default Home;
